import Navigation from './components/Navigation';
import logo from './logo.svg';
import './App.css';
import Header from './components/Header';

function App() {
  return (
	<BrowserRouter>
    	<div className="App">
			<Navigation />
			<Header />
    	</div>
	</BrowserRouter>
  );
}

export default App;
